/* eslint-disable react/no-unescaped-entities */

import { useContext } from "react";
import myContext from "../../context/myContext";

const Testimonial = () => {
    const context = useContext(myContext);
    const { mode } = context;
    return (
        <div>
            <section className="text-gray-600 body-font mb-10">
                {/* main  */}
                <div className="container px-5 py-10 mx-auto">
                    {/* Heading  
                    <h1 className={`text-center text-3xl font-bold ${mode === 'dark' ? 'text-white' : 'text-black'} `} >Testimonial</h1> */}
                    {/* para  */}
                    <h2 className=' text-center text-2xl font-semibold mb-10' >People <span className=' text-pink-500'>We</span> Helped</h2>

                    <div className="flex flex-wrap -m-4">
                        {/* Testimonial 1 */}
                        <div className="lg:w-1/3 lg:mb-0 mb-6 p-4">
                            <div className="h-full text-center">
                                <img alt="testimonial" className="w-20 h-20 mb-8 object-cover object-center rounded-full inline-block border-2 border-gray-200 bg-gray-100" src="data:image/webp;base64," />
                                <p className="leading-relaxed">Realy good website. I found my prefered job from here. Thank You #CalgaryHelp</p>
                                <span className="inline-block h-1 w-10 rounded bg-pink-500 mt-6 mb-4" />
                                <h2 className="text-gray-900 font-medium title-font tracking-wider text-sm uppercase">Dan Bilzerian</h2>
                                <p className="text-gray-500">Actor</p>
                            </div>
                        </div>

                        {/* Testimonial 2 */}
                        <div className="lg:w-1/3 lg:mb-0 mb-6 p-4">
                            <div className="h-full text-center">
                                <img alt="testimonial" className="w-20 h-20 mb-8 object-cover object-center rounded-full inline-block border-2 border-gray-200 bg-gray-100" src="data:image/webp;base64," />
                                <p className="leading-relaxed">Thank You #CalgaryHelp for helping me find a good property. Didn't had to buy a bank this time.</p>
                                <span className="inline-block h-1 w-10 rounded bg-pink-500 mt-6 mb-4" />
                                <h2 className="text-gray-900 font-medium title-font tracking-wider text-sm uppercase">Bruce Wayne</h2>
                                <p className="text-gray-500">Batman</p>
                            </div>
                        </div>

                        {/* Testimonial 3 */}
                        <div className="lg:w-1/3 lg:mb-0 p-4">
                            <div className="h-full text-center">
                                <img alt="testimonial" className="w-20 h-20 mb-8 object-cover object-center rounded-full inline-block border-2 border-gray-200 bg-gray-100" src="data:image/jpeg;base64," />
                                <p className="leading-relaxed">Finally found a house where I can park all my bugattis. Thank You #CalgaryHelp</p>
                                <span className="inline-block h-1 w-10 rounded bg-pink-500 mt-6 mb-4" />
                                <h2 className="text-gray-900 font-medium title-font tracking-wider text-sm uppercase">Andrew Tate</h2>
                                <p className="text-gray-500">Top G</p>
                            </div>
                        </div>
                    </div>
                </div>
            </section>
        </div>
    )
}

export default Testimonial